import React from 'react';

async function Demo() {
  let result = 0;
  WebAssembly.instantiateStreaming(fetch("add.wasm"), importObject).then(
    (results) => {
      // store results in result variable
      result = results.instance.exports.add(1, 2);
    }
  );  

  return (
    <div>
      <p>First trial of embedding webassembly</p>
      <p>test {result}</p>
    </div>
  );
}

export default Demo;
